{"5": ["Отличные лампы! Поставила на 3 окна, на одно окно сделала подставку из труб - делать легко, всё купила в строительном, на другие прикрепила с помощью зубной нити. Все 4 лампы пришли целые, рабочие, с полным комплектом (провод-переходник, крепление, провод для разетки).", "2021-05-01T20:13:28Z", "белый", "0", 5, 0, 5, "Светильник светодиодный линейный для роста растений, светло-розовое свечение ФИТО 20 Вт 230В 1173 мм", "IN-home"], "14": ["Товар пришел без крепления горит половина лампы", "2021-04-10T05:05:05Z", "белый", "0", 1, 0, 1, "Светильник светодиодный линейный для роста растений, светло-розовое свечение ФИТО 20 Вт 230В 1173 мм", "IN-home"], "18": ["Разочарована(", "2021-04-05T13:51:36Z", "белый", "0", 0, 1, 1, "Светильник светодиодный линейный для роста растений, светло-розовое свечение ФИТО 20 Вт 230В 1173 мм", "IN-home"], "19": ["Заказала две лампы. Упаковка в родной коробке и умотана пленкой сверху. Коробки, конечно, просто пожёваны. При лампах все комплектующие на месте. Но одна лампа просто согнута пополам. Возврат. Вторая идеальна. Жаль что хорошие лампы так доставляются. Упаковочку бы пожёстче ", "2021-04-05T13:17:04Z", "белый", "0", 0, 1, 5, "Светильник светодиодный линейный для роста растений, светло-розовое свечение ФИТО 20 Вт 230В 1173 мм", "IN-home"], "24": ["Отличная лампа! Рекомендую!", "2021-04-01T11:04:21Z", "белый", "0", 1, 0, 5, "Светильник светодиодный линейный для роста растений, светло-розовое свечение ФИТО 20 Вт 230В 1173 мм", "IN-home"], "25": ["Лампа большая, как раз на всю ширину окна. Но пришла с дефектом, новую ждать уже не могу и т.к. эта лампа работает возвращать не стала. Очень прошу обратить внимание на доставку, явно это не производитель. Заеду убираю за это.", "2021-03-25T14:40:58Z", "белый", "0", 2, 0, 4, "Светильник светодиодный линейный для роста растений, светло-розовое свечение ФИТО 20 Вт 230В 1173 мм", "IN-home"], "27": ["Пришла одна лампа , упаковка рваная,  грязная ,заклеяная скотчем, но лампа в нормальном состоянии , а комплектующих к ней вообще ничего не было , одна бумажка паспорт . Выкупила , так как уже нет сил перезаказ делать и так долго ждать приходится.  ВОПРОС к представителю - Может вы хотя бы сетевой шнур вышлите?", "2021-03-19T14:56:58Z", "белый", "0", 1, 0, 4, "Светильник светодиодный линейный для роста растений, светло-розовое свечение ФИТО 20 Вт 230В 1173 мм", "IN-home"], "30": ["Пришёл в неполной комплектации, плюс очень долгая доставка, отказ", "2021-03-10T15:45:16Z", "белый", "0", 1, 0, 1, "Светильник светодиодный линейный для роста растений, светло-розовое свечение ФИТО 20 Вт 230В 1173 мм", "IN-home"], "38": ["спасибо магазину за доставку, переживали что приедут мятые или битые, но как и в первый раз доставили в целости, без дефектов. заказывала три штуки, в двух из трёх отсутствовал комплект креплений. мне не критично, но лучше бы производитель предусмотрел этот момент, и упаковку укрепили скотчем, чтобы не вываливались. \nсами лампы отличные, неделей ранее покупала такую же только меньшего размера. растения очень быстро отвечают на досвечивание ускорением темпа роста. за 14часов работы нагреваются вообще незначительно, чуть-чуть теплее рук. \nсвет глаза не раздражает, ближе к белому, рассеивает отлично. \nсетевой кабель коротковат, но на стеллаже из 3 полок проблема легко решается удлинителем с 3 вилками.", "2021-03-02T14:53:53Z", "белый", "0", 2, 0, 5, "Светильник светодиодный линейный для роста растений, светло-розовое свечение ФИТО 20 Вт 230В 1173 мм", "IN-home"], "43": ["Лампа работает,  розового цвета при свечении нет,   корпус светильника  по середине поврежден.  Возврат.", "2021-01-21T15:41:12Z", "белый", "0", 2, 0, 1, "Светильник светодиодный линейный для роста растений, светло-розовое свечение ФИТО 20 Вт 230В 1173 мм", "IN-home"], "44": ["Заказала 3 штуки для стоек с цветами в зимний сад, пришли в полной комплектации без нареканий!спасибо производителю за качественный товар!!!до этого покупала аналогичные лампы другого производителя в два раза меньше и вдвое дороже. Однозначно рекомендую к покупке и буду заказывать ещё!", "2021-01-19T15:27:45Z", "белый", "0", 3, 0, 5, "Светильник светодиодный линейный для роста растений, светло-розовое свечение ФИТО 20 Вт 230В 1173 мм", "IN-home"], "46": ["Лампа очень понравилась,не смотря на то что пришла в порванной коробке перемотанной скотчем всё было на месте и целое!хочу заказать ещё такую же буду ждать когда появяться!!!", "2021-01-18T12:50:52Z", "белый", "0", 2, 0, 5, "Светильник светодиодный линейный для роста растений, светло-розовое свечение ФИТО 20 Вт 230В 1173 мм", "IN-home"], "47": ["Лампа отличная, единственный минус это короткий шнур", "2021-01-18T06:47:30Z", "белый", "0", 1, 0, 5, "Светильник светодиодный линейный для роста растений, светло-розовое свечение ФИТО 20 Вт 230В 1173 мм", "IN-home"], "48": ["Заказываю третью по счету, ну у кого фантазия бедная, прилагаю фото", "2021-01-12T21:14:30Z", "белый", "0", 7, 0, 5, "Светильник светодиодный линейный для роста растений, светло-розовое свечение ФИТО 20 Вт 230В 1173 мм", "IN-home"], "49": ["Жена. Ребят, оценка производителю, а не ВБ. Хранение и доставка ВБ-уже давно лотерея, то гидролат прогорклый привезут, то вместо одной вещи другую. У меня уже 2 мес работают такой длинный светильник и покороче, цветы ожили,обрадовались, появились нов листочки. Нужен был ещё один длинный. Полн комплект привезли с 4й попытки. Производителю:придумайте, пжта, коробочку для крепежа внутрь и залейте её намертво фирмен скотчем.\nСам светильник супер, 5 баллов", "2021-01-11T14:08:38Z", "белый", "0", 4, 0, 5, "Светильник светодиодный линейный для роста растений, светло-розовое свечение ФИТО 20 Вт 230В 1173 мм", "IN-home"], "50": ["Купила на пробу сначала одну лампу. Очень волновалась, в каком виде придет. Пришла в коплекте, коробка не помята. После чего докупила еще две лампв, которые так же пришли в нормальном состоянии и в полной комплектации. Как отреагируют на них цветы  покажет время. Цвет слегка с розовинкой  ближе к белому. Пока лампами довольна.", "2021-01-11T13:31:42Z", "белый", "0", 3, 0, 5, "Светильник светодиодный линейный для роста растений, светло-розовое свечение ФИТО 20 Вт 230В 1173 мм", "IN-home"], "51": ["Отличный товар! Упакован идеально: короб, пакет, переходник,  кабель питания, крепление, паспорт изделия. Свет, как и заявлено, бледно-розовый. Очень рада. Спасибо!", "2021-01-10T12:25:49Z", "белый", "0", 2, 0, 5, "Светильник светодиодный линейный для роста растений, светло-розовое свечение ФИТО 20 Вт 230В 1173 мм", "IN-home"], "52": ["Не заказывайте эти светильники, возят сломанные от одного покупателя к другому. Вчера пришел светильник без кабеля, видимо тот же самый, что и Елене 28 декабря. Муж заказывал два раза, один пришел весь на скотч склеенный, второй раз лопнутый по средине, из-за небрежной транспортировки. Пока этот сломаный товар и недокомплект, не уберут с продажи, смысла заказывать нет.", "2021-01-07T13:09:17Z", "белый", "0", 1, 0, 1, "Светильник светодиодный линейный для роста растений, светло-розовое свечение ФИТО 20 Вт 230В 1173 мм", "IN-home"], "54": ["Дважды лампа по заказу приходила измятая и лопнутая, видно что лампы путешествуют такими не первый месяц. ", "2021-01-07T10:30:01Z", "белый", "0", 1, 0, 1, "Светильник светодиодный линейный для роста растений, светло-розовое свечение ФИТО 20 Вт 230В 1173 мм", "IN-home"], "55": ["Пришёл не разбитый, в рабочем состоянии, но руки конструктору и сборщику оторвать хочется, выключатель вываливается, свет обычный белый, розовым и не пахнет. Товар реально г.... с большой буквы ( привет производителю).  Не комплект, нет крепежных элементов.", "2021-01-04T12:17:28Z", "белый", "0", 4, 0, 3, "Светильник светодиодный линейный для роста растений, светло-розовое свечение ФИТО 20 Вт 230В 1173 мм", "IN-home"], "57": ["Лампа хорошая, снимаю звезду за НЕ ДОКОМПЛЕКТАЦИЮ заявленых деталей, был только шнур для питания и переходник.", "2020-11-08T14:31:03Z", "белый", "0", 1, 0, 4, "Светильник светодиодный линейный для роста растений, светло-розовое свечение ФИТО 20 Вт 230В 1173 мм", "IN-home"], "59": ["Очень ждала эту лампу, но пришел кошмар. Коробка вся мятая и рваная, лампа треснула и помялась! Как ее везли непонятно, не упакована вообще. Даже в пункте выдачи удивились, почему так плохо упаковано. Очень жаль, что такой ужасный товар за такие деньги.", "2020-12-24T09:47:49Z", "белый", "0", 1, 1, 1, "Светильник светодиодный линейный для роста растений, светло-розовое свечение ФИТО 20 Вт 230В 1173 мм", "IN-home"], "60": ["Оценить товар затрудняюсь, т.к. сразу был оформлен возврат. Отзыв о продавце. Товар пришёл в коробке, которую открывали многократно. Комплектующих (провод, крепёж, заглушка) не было, лампа мятая. Повидимому мой возврат уже N-ый по счёту. Возмущает недобросовестность продавца. Упорно впаривать такой товар. Хорошо, что проверила сразу при получении.", "2020-12-24T08:10:31Z", "белый", "0", 1, 1, 1, "Светильник светодиодный линейный для роста растений, светло-розовое свечение ФИТО 20 Вт 230В 1173 мм", "IN-home"], "61": ["Каробка пришла вся мятая,вся переклееная скотчем без провода,креплений и всего остального.Неужели не стыдно за такую доставку.Наверно еще снимете процент выкупа?", "2020-12-22T19:42:28Z", "белый", "0", 1, 1, 1, "Светильник светодиодный линейный для роста растений, светло-розовое свечение ФИТО 20 Вт 230В 1173 мм", "IN-home"], "62": ["Пришёл недокомплект, крепления не было и пластиковой заглушки. Взяли все равно, крепили на двухсторонний скотч. Главное, светильник без повреждений и работает. Свекровь довольна!", "2020-12-22T13:50:18Z", "белый", "0", 2, 0, 5, "Светильник светодиодный линейный для роста растений, светло-розовое свечение ФИТО 20 Вт 230В 1173 мм", "IN-home"], "63": ["Очень ждала, но видимо гуляет по стране один и тот же светильник, без провода и крепления...жаль...И мне не повезло( Уважаемые!!! Обратите внимание и уберите этот \"не докомлект\"...", "2020-12-21T13:09:01Z", "белый", "0", 4, 0, 1, "Светильник светодиодный линейный для роста растений, светло-розовое свечение ФИТО 20 Вт 230В 1173 мм", "IN-home"], "64": ["К сожалению не смогла оценить по достоинству, пришёл хороший, целый светильник, но...  без кабеля и прочих комплектующих. Очень был нужен, но...  получился возврат, увы.", "2020-12-18T15:43:12Z", "белый", "0", 1, 1, 3, "Светильник светодиодный линейный для роста растений, светло-розовое свечение ФИТО 20 Вт 230В 1173 мм", "IN-home"], "66": ["Светильниц понравился. Временами кажется что свет белый, но он бледно розовый. Посмотрим как он понравится рассаде.", "2020-12-12T18:59:24Z", "белый", "0", 1, 0, 5, "Светильник светодиодный линейный для роста растений, светло-розовое свечение ФИТО 20 Вт 230В 1173 мм", "IN-home"], "67": ["Пришла не упакованная, в трубке из картона (которая когда то была коробкой), лампа вывалилась пока мне ее несли, никаких комплектующих естественно нет, ни шнура, ни переходника. Отвратительно. Заказала две лампы - обе в таком виде. Вы за это г...но еще с меня процент выкупа высчитаете? Вы считаете нормальным такое отношение к клиентам?", "2020-12-09T18:15:01Z", "белый", "0", 3, 0, 1, "Светильник светодиодный линейный для роста растений, светло-розовое свечение ФИТО 20 Вт 230В 1173 мм", "IN-home"], "68": ["Пришёл с вырванной нижней частью коробки и без шнура!! Возврат!", "2020-12-06T12:15:26Z", "белый", "0", 1, 0, 1, "Светильник светодиодный линейный для роста растений, светло-розовое свечение ФИТО 20 Вт 230В 1173 мм", "IN-home"], "69": ["Пришел с вмятиной и трещиной. Возврат", "2020-12-05T08:45:42Z", "белый", "0", 1, 0, 2, "Светильник светодиодный линейный для роста растений, светло-розовое свечение ФИТО 20 Вт 230В 1173 мм", "IN-home"], "70": ["Заказала,получила две лампы,на одной была вмятина на внешней стороне,но на работе не отразилась.Растючки пошли в рост,но придя сегодня домой,увидела,что одна из ламп половина лампы не работает, в работе лампа была по 12-15 часов в сутки 2-3 недели.\nИ что теперь делать?", "2020-12-03T17:21:48Z", "белый", "0", 2, 1, 3, "Светильник свето